//SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';

contract Ticket is Ownable{
  IERC20 public labInstance;
  address public ownerWallets;


  constructor(IERC20 _labInstance) public{
    labInstance = _labInstance;
    ownerWallets = 0x937c68270aB59cfCFc3b39115246eB0030aA9233;
  }

    function withdrawAll() external onlyOwner{
      uint ownerBalance = labInstance.balanceOf(address(this));
      labInstance.transfer(ownerWallets, ownerBalance);
  }

  // function getOwnerWallet() external view returns(address){
  //   return ownerWallet;
  // }

  function changeOwnerWallet(address newOwner) external onlyOwner{
    ownerWallets = newOwner;
  }

}
